BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "document_titles" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "equipment_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(90) NOT NULL);
CREATE TABLE IF NOT EXISTS "role_names" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "role_name" varchar(90) NOT NULL);
CREATE TABLE IF NOT EXISTS "document_clients" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uploaded" bool NOT NULL, "upload_date" datetime NULL, "file" varchar(100) NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "document_id" bigint NOT NULL REFERENCES "document_titles" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "equipment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "item_number" varchar(90) NOT NULL, "make" varchar(90) NOT NULL, "model" varchar(90) NOT NULL, "serial_number" varchar(90) NOT NULL, "equipment_group_id" bigint NOT NULL REFERENCES "equipment_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "equipment_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "equipment_id" bigint NOT NULL REFERENCES "equipment" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "equipment_test" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "calibrate_date" date NULL, "calibrate_freq" integer NULL, "service_date" date NULL, "servcice_freq" integer NULL, "inspection_date" date NULL, "inspection_freq" integer NULL, "test_date" date NULL, "test_freq" integer NULL, "equipmentuser_id" bigint NOT NULL REFERENCES "equipment_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "qualification" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "qualification_name" varchar(90) NOT NULL, "duration" integer NULL, "role_id" bigint NOT NULL REFERENCES "role_names" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "staff" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "first_name" varchar(90) NOT NULL, "last_name" varchar(90) NOT NULL, "staff_id" varchar(45) NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "staff_qualification" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "qualification_date" date NULL, "qualification_id" bigint NOT NULL REFERENCES "qualification" ("id") DEFERRABLE INITIALLY DEFERRED, "staff_id" bigint NOT NULL REFERENCES "staff" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "staff_role" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "role_id" bigint NOT NULL REFERENCES "role_names" ("id") DEFERRABLE INITIALLY DEFERRED, "staff_id" bigint NOT NULL REFERENCES "staff" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "user_profile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "business_name" varchar(45) NULL, "address_one" varchar(45) NULL, "address_two" varchar(45) NULL, "town" varchar(45) NULL, "county" varchar(45) NULL, "postcode" varchar(15) NULL, "telephone" varchar(20) NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
